import {
  ChangeDetectionStrategy,
  Component,
  Input,
  OnInit,
} from '@angular/core';

export type SupportedIcon =
  | 'cart-plus'
  | 'star'
  | 'star-half-o'
  | 'star-o'
  | 'envelope';

export type SupportedColor =
  | 'primary'
